pub enum BackendError {
    ForeignPanic {
    },
    BadArgument {
    },
    InvalidUtf8 {
    },
    IteratorDoesNotExist {
        id: u32,
    },
    OutOfGas {
    },
    Unknown {
        msg: Option<String>,
    },
    UserErr {
        msg: String,
    },
}

pub enum CommunicationError {
    DerefErr {
        offset: u32,
        msg: String,
    },
    InvalidOrder {
        value: i32,
    },
    InvalidRegion {
        source: RegionValidationError,
    },
    InvalidUtf8 {
        msg: String,
    },
    RegionLengthTooBig {
        length: usize,
        max_length: usize,
    },
    RegionTooSmall {
        size: usize,
        required: usize,
    },
    ZeroAddress {
    },
}

pub enum RegionValidationError {
    LengthExceedsCapacity {
        length: u32,
        capacity: u32,
    },
    OutOfRange {
        offset: u32,
        capacity: u32,
    },
    ZeroOffset {
    },
}

pub enum VmError {
    BackendErr {
        source: BackendError,
    },
    CacheErr {
        msg: String,
    },
    CommunicationErr {
        source: CommunicationError,
    },
    CompileErr {
        msg: String,
    },
    ConversionErr {
        from_type: String,
        to_type: String,
        input: String,
    },
    CryptoErr {
        source: CryptoError,
    },
    GasDepletion {
    },
    GenericErr {
        msg: String,
    },
    InstantiationErr {
        msg: String,
    },
    IntegrityErr {
    },
    ParseErr {
        target_type: String,
        msg: String,
    },
    DeserializationLimitExceeded {
        length: usize,
        max_length: usize,
    },
    SerializeErr {
        source_type: String,
        msg: String,
    },
    ResolveErr {
        msg: String,
    },
    ResultMismatch {
        function_name: String,
        expected: usize,
        actual: usize,
    },
    RuntimeErr {
        msg: String,
    },
    StaticValidationErr {
        msg: String,
    },
    UninitializedContextData {
        kind: String,
    },
    WriteAccessDenied {
    },
}
